import React from "react";
import ReactPaginate from "react-paginate";

function Pagination() {
  return (
    <ReactPaginate
      cla
      breakLabel="..."
      nextLabel=">"
      onPageChange={handlePageClick}
      pageRangeDisplayed={5}
      pageCount={pageCount}
      previousLabel="<"
      renderOnZeroPageCount={null}
    />
  );
}

export default Pagination;
